import React from 'react'
import {ThemeProvider,createMuiTheme, makeStyles,Paper} from '@material-ui/core'
import Navbar from './Navbar'

const theme = createMuiTheme({
  palette: {
    type: 'dark'
  },

});

export default function ChannelInfo(){


	return (
		<React.Fragment>
			<ThemeProvider theme={theme}>
			<Navbar/>
			<Paper>Hello</Paper>
			</ThemeProvider>
		</React.Fragment>
		)
}
